  return (
    <React.Fragment>
      <div className="edit-post-container"></div>

      <style jsx>{`
        .edit-post-container {
          width: 92%;
          margin: 0 auto;
          height: 200px;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default EditPost;
